import React from "react";
import { Link } from "react-router-dom";
import SideBar from "./SideBar";
import Themebtn from "./Themebtn";
import logo from "../Images/mylogo.png";

const NavBar = () => {
  return (
    <nav class="flex fixed w-full gap-20 z-[999] ring-1 ring-slate-700">
      <div>
        <SideBar />
      </div>

      <div className="z-50 pt-2 ml-50">
        <Link to={"/"}>
          <img src={logo} alt="myLogo" className="w-40 h-12" />
        </Link>
      </div>
      <div className="absolute flex gap-6 mt-2 text-2xl justify-items-end right-40 ">
        <a href="www.facebook.com">
          <i class="fa-brands fa-linkedin hover:"></i>
        </a>
        <a href="www.facebook.com">
          <i class="fa-brands fa-github"></i>
        </a>
        <a href="www.facebook.com">
          <i class="fa-brands fa-facebook"></i>
        </a>
        <a href="www.facebook.com">
          <i class="fa-brands fa-square-instagram"></i>
        </a>
      </div>
      <div>
        <Themebtn />
      </div>
    </nav>
  );
};

export default NavBar;
